import './index.scss'

const SkillsBall = (skillsArray) => {
  const TagCloud = require('TagCloud')

  const container = '.tagcloud'
  const texts = [];
  skillsArray.forEach(element => {
    texts.push(element)
  });
  const options = {}

  return TagCloud(container, texts, options)
}

export default SkillsBall
